def repeatedStringMatch(A, B):
    """
    :type A: str
    :type B: str
    :rtype: int
    """
    count=1
    tem=A
    if B in A:
        return 1
    if set(A)!=set(B):
        print(set(A),set(B))
        return -1
    while count<=len(A):
        if B in A:
            return count
        else:
            A+=tem
            count+=1
    return -1
